// FetchDataPage.js

import React, { useState } from 'react';

const FetchDataPage = () => {
  const [criteria, setCriteria] = useState({
    name: '',
    school: '',
    week: '',
  });
  const [fetchedData, setFetchedData] = useState([]);

  const handleFetchData = async () => {
    try {
      const queryParams = new URLSearchParams(criteria);
      const response = await fetch(`/api/entries?${queryParams}`);
      const result = await response.json();

      if (result.length > 0) {
        setFetchedData(result);
      } else {
        setFetchedData([]);
      }

      console.log(result);
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  return (
    <div style={{ maxWidth: '400px', margin: 'auto' }}>
      <h2>Fetch Data</h2>
      <label htmlFor="name">Name:</label>
      <input
        type="text"
        id="name"
        value={criteria.name}
        onChange={(e) => setCriteria({ ...criteria, name: e.target.value })}
      />

      <label htmlFor="school">School:</label>
      <input
        type="text"
        id="school"
        value={criteria.school}
        onChange={(e) => setCriteria({ ...criteria, school: e.target.value })}
      />

      <label htmlFor="week">Week:</label>
      <input
        type="text"
        id="week"
        value={criteria.week}
        onChange={(e) => setCriteria({ ...criteria, week: e.target.value })}
      />

      <button onClick={handleFetchData}>Submit</button>

      <div style={{ marginTop: '20px' }}>
        {fetchedData.length > 0 ? (
          <table>
            <thead>
              <tr>
                <th>Name</th>
                <th>School</th>
                <th>Week</th>
                <th>Competencies Met</th>
              </tr>
            </thead>
            <tbody>
              {fetchedData.map((data) => (
                <tr key={data._id}>
                  <td>{data.name}</td>
                  <td>{data.school}</td>
                  <td>{data.week}</td>
                  <td>{data.competenciesMet}</td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>No data available</p>
        )}
      </div>
    </div>
  );
};

export default FetchDataPage;
